import React from "react";
import "../styles/TakeAction.css";

function TakeAction() {
    return (
        <div className="take-action">
            <h1>Take Action Now</h1>
            <p>There are many ways to make a difference. Every small step counts!</p>
            <ul>
                <li>Reduce, Reuse, and Recycle</li>
                <li>Switch to Renewable Energy</li>
                <li>Use Energy-Efficient Appliances</li>
                <li>Support Climate-Friendly Companies</li>
                <li>Educate Others About Climate Change</li>
            </ul>
        </div>
    );
}

export default TakeAction;
